import React, {Component} from 'react';
import LoginForm from './loginForm';

export default class rightPanel extends Component {
  render() {
    return (
      <div id="rightPanelWrapper">
        <div id="logoDiv">
            <image src = "client/src/imgs/RightPanelLogo.svg"></image>
        </div>
        <LoginForm />
      </div>
    );
  }
}
